import React from "react";
import PropTypes from "prop-types";

import "./Goback.css";

/**
 * 返回栏页头
 * @param {onClickArrowforback} 点击<- (返回)按钮
 * @param {onClickArrowforward} 点击-> (前进)按钮
 * @returns
 */

function Goback(props) {
  var onClickArrowforback = props.onClickArrowforback,
      onClickArrowforward = props.onClickArrowforward;

  return React.createElement(
    "div",
    { className: "goback-wrap" },
    React.createElement(
      "div",
      { className: "arrowforback", onClick: onClickArrowforback },
      React.createElement("img", {
        className: "arrow-icon",
        src: require("../../public/arrowforback-icon.png")
      })
    ),
    React.createElement(
      "div",
      { className: "arrowforward", onClick: onClickArrowforward },
      React.createElement("img", {
        className: "arrow-icon",
        src: require("../../public/arrowforward-icon.png")
      })
    )
  );
}
Goback.protoTypes = {
  onClickArrowforback: PropTypes.func,
  onClickArrowforward: PropTypes.func
};
Goback.defaultProps = {
  onClickArrowforward: function onClickArrowforward() {
    console.log("->");
  },
  onClickArrowforback: function onClickArrowforback() {
    console.log("<-");
  }
};

export default Goback;